import React from 'react'
import { Grid, Image } from 'semantic-ui-react'

export default function tumkampanyalar() {

    const image=
    {
        width :"210px",
        height:"400px",
    }

    return (

        <Grid verticalAlign='top' columns={8}>
        <Grid.Row>
          <Grid.Column>
            <Image style={image} src='https://react.semantic-ui.com/images/wireframe/image.png' />
          </Grid.Column>
          <Grid.Column>
            <Image  src='https://react.semantic-ui.com/images/wireframe/image.png' />
          </Grid.Column>
        </Grid.Row>
      </Grid>
    )
}
